import React, { Fragment, Component } from "react";
import "./App.css";

class App extends Component {
  //foo = () => "Bars";

  render() {
    const name = "John Doe";
    const loading = false;

    if (loading) {
      return <h4>Loading....</h4>;
    }

    return (
      <Fragment>
        <h1>Hello {name}</h1>
      </Fragment>
    );
  }
}

export default App;
